import './../Style/EditProfile.css';
import { Link, useParams, useNavigate } from "react-router-dom";
import { useState, useEffect } from "react";
import {variables} from "../Variables";
import Swal from 'sweetalert2'
import withReactContent from 'sweetalert2-react-content'

function AppPayment(){
    const [price, setPrice] = useState(0);
    const [order, setOrder] = useState('');
    const { id } = useParams();

    useEffect(() => {
        fetch(variables.API_URL+"get_order/"+id, {
            method: "GET",
            headers: {
                'Accept': 'application/json, text/plain',
                'Content-Type': 'application/json;charset=UTF-8'
            },
            })
            .then(response => response.json())
            .then(result => {
                console.log(result)
                if(result.length > 0){
                    setOrder(result[0])
                }
            }
        )
    }, [])

    if(order.id){
        return(
            <div className='EditProfile'>
                <div className="contianer-ED">
                    <div className="ED-frame">
                        <form id="ED-form" >
                        <span className="topic-ED">
                        Payment<br />
                        </span>
                        <span className="topic-ED">
                        total_price : {order.total_price} B<br />
                        </span>
                        <div className="input-frame">
                            <form>
                                <div className="input-frame">
                                    <input className="input" id="register-FirstName" type="number" name="firstName"
                                    placeholder="First Name" value={price} onChange={(e) => setPrice(e.target.value)} required/>
                                    <span className="symbol">
                                        <i className="fa-solid fa-wallet"></i>
                                    </span>
                                </div>
                                <div className="submit-frame">
                                    <input id="submit" type="submit" value="submit" />
                                </div>
                            </form>
                        </div>
                        </form>
                    </div>
                </div>
            </div>
            );
    }
}

export default AppPayment;
